    is_loggedin(){
        const token = localStorage.getItem('access_token');
        if(token){
            return <Redirect to="/admin/dashboard"/>
        }
        else{
            return <Redirect to="/admin"/>
        }
    }
    render() {
        return (
            <div>
                
            </div>
        )
    }
}
